nodes:
    - type: backgroundImage
      backgroundImage: MusicianHouse
    - type: music
      musicId: KingOfTheMountain
    - type: speakers
      left:
          - Musician
      right:
          - Rayman
          - Globox
    - type: dialog
      speaker: Musician
      text:
          ja-JP: よー‘皆様‘みなさま‘！お‘久‘ひさ‘しぶりですね。ギターを‘弾‘はじ‘いてみよ！
          en-US: Hi Buddies! Long time no see! Let's play some guitar!
          he-IL: היי חברים! הרבה זמן לא נפגשנו. בואו ננגן בגיטרה!
      audio:
          ja-JP: d103da96cdb11
          en-US: 5e92f37f2aef4
          he-IL: ae21461ae5377
    - type: dialog
      speaker: Rayman
      text:
          ja-JP: すげーじゃん！MUSICIANさん！それはあの‘時‘とき‘の‘救‘すく‘われたギターだろうな？
          en-US: Wow! Mr. Musician! Isn't that the guitar that I've rescued at that time?
          he-IL: וואו! מוזיקאי, האם זאת הגיטרה שהצלתי פעם?
      audio:
          ja-JP: 6f591a96e188
          en-US: 22c660094d912
          he-IL: da3df3b00077
    - type: dialog
      speaker: Musician
      text:
          ja-JP: ‘言‘い‘った‘通‘とお‘りだよ!あの‘頃‘ころ‘にありがとうございましたな、レイマンくん
          en-US: Well said! Thanks for that, Rayman
          he-IL: נכון ריימן! תודה רבה על זה
      audio:
          ja-JP: 34e077557d8cd
          en-US: 8bacb9328db3a
          he-IL: b44cd7abdaa2b
    - type: dialog
      speaker: Rayman
      text:
          en-US: I can remember that time clearly...
          he-IL: אני זוכר את זה כאילו זה היה אתמול...
          ja-JP: あの時ね…
      audio:
          ja-JP: 3b5249743cf9
          en-US: efc5a13c7d45c
          he-IL: 7781da5f60296
    - type: filter
      filterId: Nostalgic
    - type: speakers
      left: []
      right: []
    - type: music
      musicId: TheMountainStreams
    - type: speakers
      left:
          - Musician
      right:
          - Rayman
    - type: dialog
      speaker: Rayman
      text:
          en-US: Super punch!
          he-IL: אגרוף מחץ!
          ja-JP: スーパーパンチ！
      audio:
          ja-JP: b2972040d0bc5
          en-US: 921976d476099
          he-IL: aa132d03e3048
    - type: dialog
      speaker: Musician
      text:
          en-US: Thanks, Rayman baby,
          he-IL: THANKS, RAYMAN BABY...
          ja-JP: THANKS, RAYMAN BABY...
      audio:
          ja-JP: 4223674d9d104
          en-US: 102985b957124
          he-IL: f160149428c94
    - type: filter
    - type: speakers
      left: []
      right: []
    - type: music
      musicId: PeacefulPeaks
    - type: speakers
      left:
          - Musician
      right:
          - Rayman
          - Globox
    - type: dialog
      speaker: Musician
      text:
          en-US: Long time ago huh...
          he-IL: אכן כך היה
          ja-JP: そうでしたなー…
      audio:
          ja-JP: 547487e63d9db
          en-US: bffdf13f5f0c2
          he-IL: 1af56b730510d
    - type: dialog
      speaker: Globox
      text:
          ja-JP: ‘初‘はじ‘めまして。グロボクスと‘申‘もう‘します。どうぞよろしくお‘願‘おねが‘いします
          en-US: Nice to meet you. My name is Globox. Nice place you have here
          he-IL: נעים להכיר. קוראים לי גלובוקס. הבית שלך ממש יפה
      audio:
          ja-JP: 57fd6ba85c699
          en-US: 3ec8711ba35a8
          he-IL: 3dbad797a2a5a
    - type: dialog
      speaker: Musician
      text:
          ja-JP: ああ、グロボクスさん。こちらこそ。レイマンから‘君‘きみ‘の‘事‘こと‘を‘聞‘き‘きました。
          en-US: Oh Globox, I've heard a lot about you from Rayman.
          he-IL: אז אתה גלובוקס... שמעתי עליך הרבה מריימן
      audio:
          ja-JP: a4067fa961f35
          en-US: 3f7635aada5c
          he-IL: c51764a677d2d
    - type: dialog
      speaker: Globox
      text:
          ja-JP: わたくしは、ギターで‘上手‘じょうず‘になりたいです。よろしければ、‘弟子‘でし‘になりませんか？
          en-US: I really want to be good at playing guitar. Maybe you could teach me?
          he-IL: אני רוצה לדעת לנגן טוב בגיטרה. יכול להיות שתוכל ללמד אותי איך לנגן?
      audio:
          ja-JP: 084a40d5ffafa
          en-US: 26ed4a0a17996
          he-IL: "077014407e623"
    - type: dialog
      speaker: Musician
      text:
          ja-JP: もちろんよ。今から、‘敬語‘けいご‘など‘必要‘ひつよう‘がないよ。ギターを‘弾‘はじ‘いてみませんか
          en-US: Sure Globox. Let's start learning right now, if you don't mind
          he-IL: בוודאי. אשמח ללמד אותך. בוא ונתחיל לנגן כבר עכשיו, אם יתאים לך
      audio:
          ja-JP: 85b1973124e57
          en-US: 3e3f65e55a3b7
          he-IL: 0635c596eff91
    - type: dialog
      speaker: Globox
      text:
          ja-JP: どうもありがとうございます
          en-US: Thank you
          he-IL: תודה רבה
      audio:
          ja-JP: 77f8d08e81ec4
          en-US: 7776ba50347f5
          he-IL: debab145f9132
    - type: music
      musicId: MusicianSong
    - type: dialog
      speaker: Musician
      text:
          ja-JP: わたくしの‘歌‘うた‘を‘聞‘き‘け... ♪♫
          en-US: This is my song... ♪♫
          he-IL: זהו השיר שלי... ♪♫
      shouldSpeakSlow: true
      audio:
          ja-JP: 862ea1b8445c4
          en-US: ca03795379d3f
          he-IL: 17ae004d0c26b
    - type: dialog
      speaker: Musician
      text:
          ja-JP: ♪♫ MUSICIANの‘歌‘うた‘を... ♪
          en-US: ♪♫ The musician song... ♪
          he-IL: ♪♫ השיר של המוזיקאי... ♪
      shouldSpeakSlow: true
      audio:
          ja-JP: 0a473b788806
          en-US: e43ac28e2bd72
          he-IL: 0b2d9e6968889
    - type: dialog
      speaker: Musician
      text:
          ja-JP: ...
          en-US: ...
          he-IL: ...
    - type: music
      musicId: PeacefulPeaks
    - type: dialog
      speaker: Globox
      text:
          ja-JP: すごいな！　さすがMUSICIANさん！
          en-US: Oh my gosh! That's so awesome!
          he-IL: מרשים מאוד! כל הכבוד!
      audio:
          ja-JP: c1f1eecfaac5
          en-US: 7392199f4ef8a
          he-IL: da20c3cde1f97
    - type: dialog
      speaker: Musician
      text:
          ja-JP: ありがとうなー、GLOBOXの‘兄貴‘あにき‘…
          en-US: Thanks, Globox baby...
          he-IL: תודה, גלובוקס אחי...
      audio:
          ja-JP: 82899cc6ab04b
          en-US: 840df578e7b29
          he-IL: 7c714481c38c7

